import React from 'react'
import Link from 'next/link'

import { THEME } from '../../theme'


const StyledLink = styled.a`
  cursor: pointer;
  color: ${ THEME.FONT_COLOR };
  :hover {
    color: ${ THEME.FONT_COLOR };
    text-decoration: none;
  }
`


export const AppRouterLink = ({ href, children, ...rest }) => {
  return (
    <Link href={ href } { ...rest }>
      <StyledLink>
        { children }
      </StyledLink>
    </Link>
  )
}
